from collections import Counter
from typing import List


class Solution:
    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        word_len = len(words[0])
        len_word = len(words)
        res = []
        dict_words = {}
        for i in range(len(s)):
            check_str = s[i:word_len + i]
            if check_str in words:
                temp_words = words.copy()
                temp_words.remove(check_str)
                for j in list(dict_words.keys()):
                    if i == j + word_len * (len_word - len(dict_words[j])):
                        if check_str in dict_words[j]:
                            dict_words[j].remove(check_str)
                            if len(dict_words[j]) == 0:
                                res.append(j)
                                del dict_words[j]
                        else:
                            del dict_words[j]
                if len(temp_words) == 0:
                    res.append(i)
                else:
                    if len(s) - i < len_word:
                        continue
                    dict_words[i] = temp_words
            else:
                for j in list(dict_words.keys()):
                    if i == j + word_len * (len_word - len(dict_words[j])):
                        del dict_words[j]
        return res


